import React from 'react';
import { Link } from "react-router-dom";
import logo from '../img/logo.svg';

function Gusto() {
  return (
    <main className="max-w-6xl mx-auto px-8">
      <Intro />
      <Detail />
    </main>
  );
}

function Intro() {
  return(
    <section className="flex flex-col items-center text-center my-16 md:px-16">
      <h3 className="mt-16">2016 Gusto Benefits</h3>
      <h1 className="text-4xl font-serif mb-16">Health Benefits Renewal</h1>
      <p>Gusto makes it refreshingly easy to take care of payroll, HR, and benefits for small business owners.
        This project <b>allows companies who currently offer health benefits for their employees, to renew benefits
        for the upcoming year.</b></p>
      <p>There were two main design phases, pre-launch design iterations and post-launch improvements iterations.
        As the <b>design owner</b>, I was responsible for <b>defining the project</b> with the product managers,
        <b>creating and testing the designs</b>, and <b>implementing the UI components</b> for the project. </p>
    </section>
  );
}

function Detail() {
  return (
    <section className="flex flex-col items-center">
      <div className="flex flex-col md:flex-row justify-between">
        <div className="w-1/3">
          <h5 className="text-xl mb-8">
            <strong>01 Define </strong>
            Feature Requirements and Information Architecture
          </h5>
          <p>
            I worked closely with the product manager on defining the users and use cases.
            I created a user journey map to visualize the key steps and data points, and helped us better understand
            the problem and contraints.
          </p>
        </div>
        <div className="w-1/3">
          <ul className='font-italic'>
            <li><h6><strong>e.g.</strong></h6></li>
            <li><strong>Persona</strong>: a novice small business owner (a.k.a. employer)</li>
            <li><strong>Scenario</strong>: renewing health plans for the first time</li>
            <li><strong>User needs</strong>: pick new health plans that have better coverages while keeping the cost the same</li>
            <li><strong>Goal</strong>: allow users to give us feedback about their current health plans, and provide plan recommendations that meet their needs</li>
          </ul>
        </div>
        <div className="w-1/3">

        </div>
      </div>
    </section>
);
}

export default Gusto;
